myApp.controller("themThongKeController",["$scope","$http","$window","$location","$filter","Url",function(n,t,i,r,u,f){n.ThongKe={};n.currentIdThongKe=f.getParameterByName("id");n.currentIdThongKe&&t.get("/API/ThongKeAPI/"+n.currentIdThongKe).success(function(t){n.ThongKe={id:t.id,ten:t.ten,diaChi:t.diaChi,SDT:t.SDT,email:t.email,soLanMuaHang:t.soLanMuaHang}});n.cancel=function(){i.location.href="/Admin/ThongKes"}}]);